const supabase = createClient(
    'https://yidabysarmcsabejtijt.supabase.co',
  'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InlpZGFieXNhcm1jc2FiZWp0aWp0Iiwicm9sZSI6ImFub24iLCJpYXQiOjE3NTAwODgwNjUsImV4cCI6MjA2NTY2NDA2NX0.38nx1VZB8WwcIuq6InA2Ctctc0wSfpRZrEPlhjbZxTU'
);

export default function Login() {
  return (
    <div style={{ maxWidth: 400, margin: 'auto' }}>
      <Auth
        supabaseClient={supabase}
        appearance={{ theme: ThemeSupa }}
        providers={[]} // leeg laten voor alleen email/wachtwoord
      />
    </div>
  );
}
